	add("bint", "{\"term\":\"bint\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\"], \"text\":\"From Arabic \u0027بِنْت\u0027 (girl, daughter) used to denote a patronym.The term entered the British lexicon during the occupation of Egypt at the end of the nineteenth century, where it was adopted by British soldiers to mean \u0026quot;girlfriend\u0026quot; or \u0026quot;bit on the side\u0026quot;. It is used as a derogatory slang word in the United Kingdom, meaning \u0027woman\u0027 or \u0027girl\u0027. Its register varies from that of the harsher \u0027bitch\u0027 to an affectionate term for a young woman, the latter being more commonly associated with the West Midlands. The term was used in British armed forces and the London area synonymously with \u0027bird\u0027 in its slang usage (and sometimes \u0027brass\u0027) from at least the 1950s. The term was also used in the film \u0027w:Monty Python and the Holy Grail|Monty Python and the Holy Grail\u0027, in which the w:Lady of the Lake|Lady of the Lake is referred to as a \u0026quot;moistened bint\u0026quot;, and in the phrase \u0026quot;grotty Scots bint\u0026quot; in the \u0026quot;English English\u0026quot; scene of the film \u0027w:Austin Powers in Goldmember|Austin Powers in Goldmember\u0027. It also appears in the famed British sitcom \u0027w:Fawlty Towers|Fawlty Towers\u0027, in which Basil Fawlty refers to his assistant Polly as a \u0026quot;cloth-eared bint.\u0026quot;In the Tyneside shipping industry , a Yemeni community had existed there (particularly in Laygate, in South Shields since the 1890s :- http://www.bbc.co.uk/nationonfilm/topics/family-and-community/south-shields-yemeni-riots.shtmlThe word entered the local language as it was Arabic for daughter. Although the term can be used in a derogatory sense, in general it refers simply to (usually young) females.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woman, a girl\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Tell that \u0027\u0027bint\u0027\u0027 to get herself in here now\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Austin Powers\u0027 (film\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Don\u0027t you remember the Crimbo din-din we had with the grotty Scots \u0027\u0027bint\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Monty Python\u0027s Flying Circus\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"If I went round saying I was an emperor just because some moistened \u0027\u0027bint\u0027\u0027 had lobbed a scimitar at me, they\u0027d put me away\", \"priority\":6}]}, \"synonyms\":{}}");

